        mHdltvoutHandle << " , " <<  " \"conv_1_out_0_ce0\" :  \"" << conv_1_out_0_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"conv_1_out_0_q0\" :  \"" << conv_1_out_0_q0.read() << "\" ";
